title: "Personalized Glassware : Weddings : Gifts : Occasions",
announcement: "The Engravery We feature engraved glassware that is elegant, durable, and completely unique. - Crafted to last a lifetime. - Designs are permanent and guaranteed never to wash off or fade. - Dishwasher safe and meant for everyday use. A keepsake your family and friends will forever cherish, custom glassware is perfect for so many occasions - wedding parties and favors - bridal showers - holiday gifts - birthday gifts - engagement parties - anniversaries - family reunions and vacations - bachelor and bachelorette parties - corporate events ... you name it! Nearly every occasion can be enhanced with the addition of personalized glassware! Learn more about us and our products here ~&gt; https://www.etsy.com/shop/TheEngravery/about Please feel free to reach out with any questions. Cheers! Katie & Tym",
