sale_message: "Thank you for your purchase from The Engravery! Connect With Us ------------------------ www.facebook.com/Engravery www.twitter.com/TheEngravery www.pinterest.com/TheEngravery www.instagram.com/TheEngravery ------------------------ #TheEngravery",
