accepts_custom_requests: true,
policy_welcome: "Welcome Friends! Thanks so much for stopping by. We are Katie and Tym and we make up the creative team of The Engravery. We are proudly located in Denver, Colorado and grateful every day to be part of this INCREDIBLE Etsy community. Meeting more than 10 years ago, our love for each other and for experiencing life has led us to follow our passions, creating beautiful works of art and sharing them with the world. Adventurers with an eye for design we knew we wanted to create our own path, taking our ideas from dreams to fruition. We&#39;ve traveled near and far meeting folks from all walks of life. We&#39;ve been inspired, motivated, and amazed by our experiences and each one has led us to where we are today. By joining our computer-savvy design skills, respect for handcrafted arts and strong interpersonal relations knowledge we&#39;ve created The Engravery, our Etsy shop dedicated to personalized glassware and custom gifts. We are so thankful for the opportunity to live our dream and we would be more than honored to be part of your celebration. Personalized glassware adds that &#39;special touch&#39; to any occasion and creates a lasting keepsake your family and friends will forever cherish. Cheers! Katie & Tym",
policy_payment: "We accept many different payment options through Etsy including: Etsy gift cards, Paypal and most major credit cards. *Please allow 7-10 business days for all custom creations. RUSH Processing is available, please inquire for details. *Sales tax applies to all Colorado orders. Thank you!",
policy_shipping: "It is our goal to complete orders as quickly as possible. Our normal processing time for personalized orders is 7-10 business days. If you would like to have your order processed faster than the stated handling time, please message us for details regarding rush processing. The Engravery uses the United States Postal Service as our shipping carrier. We securely bubble-wrap each item individually to provide added cushion and support while shipping. We ship Priority Mail and USPS estimates shipping times at 2-3 business days to most major US cities. Tracking information is included with all orders and will be uploaded to your Etsy sales record as soon as it becomes available. To track your package please visit www.usps.com and enter your tracking number into the space provided on the homepage. *Please understand: The Engravery cannot take responsibility for loss/late/damaged items on behalf of USPS. If your item arrives damaged please follow the procedure outlined in the Refund Policy.",
policy_refunds: "We strive to create custom, one-of-a-kind pieces that are elegant, durable, and 100% accurate. We use professional grade equipment that ensures each of your requests will be permanently engraved onto the glassware of your choice. Please review your personalization requests thoroughly before submitting your order. Due to the nature of our business all custom engraved items are final sale and cannot be returned or exchanged. Our goal is to create the look you&#39;re hoping for and we want all of our clients to have the best experience possible at The Engravery. Please understand that while consistency and accuracy are our main goals these items are all hand crafted and may have their own thumbprint. *Please NOTE: If items are damaged during shipping they will be replaced. To file a claim and qualify for our Free Replacement Guarantee please contact us via Etsy and provide the following information within 48 hours of receiving your glassware: - Your name - Number of items damaged - Description of items damaged *Please also attach a photo of any/all damaged items to an Etsy message, required.* **Buyer pays all applicable USPS shipping fees. We&#39;re very sorry, however claims filed outside the 48 hour time frame may not be accepted. Thank you for understanding. - Once your claim has been received we will get back with you as soon as able and guide you through the claim process. *Any misprinted items, or mistakes on our behalf, will be replaced even if notified outside of the 48 hour window. Please feel free to reach out with any questions. Thank you!",
policy_additional: "Connect With Us ------------------------ Facebook @ www.facebook.com/Engravery Twitter @ www.twitter.com/TheEngravery Pinterest @ www.pinterest.com/TheEngravery Instagram @ www.instagram.com/TheEngravery ",
