vacation_message: "Thank you for visiting Liquid Courage! We specialize in flasks to match every personality. All flasks are now available in your choice if 8 oz, 6 oz, or 4 oz sizes for the same low price. Don&#39;t see what you are looking for, have your own idea or image, or want multiples of certain designs? Convo us for a custom listing.",
sale_message: "Thank you for your purchase from Liquid Courage Flasks! Be sure to sign up for our newsletter to stay up to date with our latest designs, discounts, and giveaways! NEWSLETTER SIGNUP LINK: http://eepurl.com/FP_fT -Shipping- Our items typically ship within 2 business days and have an estimated delivery time of 2-5 business days within the United States. If you purchased a custom item, a convo will be sent to you shortly to request more information or to approve a mock up. Please let us know if you have any questions. -International Shipping- International shipments have an estimated delivery time of 6-10 business days from the time of shipment. Please note that the shipping time may vary due to customs policies in your country. International customers are responsible for all Destination Duties, Taxes, and Import Charges. Amy and Tyler Fisk Liquid Courage 888-959-2870 sales@liquidcourageflasks.com",
