accepts_custom_requests: true,
policy_welcome: "Hello and welcome to our shop! My name is Amy, and my husband, Tyler and I are the owners and creators of Liquid Courage. We have been selling online since 2003. Recently, we decided to make the leap from selling items made by others to selling items that we make. We have been goofing around making all sorts of arts, crafts, scrapbooks, and clothing for many years and decided to combine my hobby with my online business experience. Tyler has an Accounting degree from Tennessee Technological University, and I have a bachelor&#39;s degree in Marketing and an MBA in Accounting from TTU as well. Upon graduating, we tried &quot;real, grown-up jobs&quot; - Tyler as a general manager at a greenhouse manufacturing company, and I as a staff accountant for a nationwide manufacturing company. We spent a couple of years working for &quot;the man&quot;...at a desk eight hours a day...fifty weeks a year. We finally decided to follow our dream of becoming entrepreneurs, pursue our passion, and determine our own future with hands on approach. We chose the path less traveled by, and that has made all the difference. Please don&#39;t hesitate to ask if you have any questions or would like a custom item. (888) 959-2870 (M-F 9am - 5pm Eastern) or Convo us anytime! Cheers! Tyler and Amy",
