policy_shipping: "Flasks ship within 1-2 business days unless otherwise noted in the shop header. Items are shipped via USPS Priority Mail or First Class Mail and have an estimated arrival time of 2-5 business days from the time of shipment. INTERNATIONAL SHIPPING: We ship internationally via USPS Priority Mail which has an estimated delivery time of 6-10 business days. International customers are responsible for all Destination Duties, Taxes, and Import Charges. Please note the shipping time may vary due to customs policies in your country. CUSTOM ORDERS: We do not ship custom orders until the buyer approves the custom mock up.",
policy_refunds: "Please contact us if you have an issue with any part of the transaction, and we will work it out. If you are unsatisfied in any way, please contact us first and allow us the chance to resolve the issue. Returns: We offer returns less initial shipping, and we do not refund return shipping charges.",
policy_additional: "NEW & IMPROVED FLASK MAKING PROCESS: Liquid Courage flasks are handmade creations, and we have spent over 3 years tweaking and improving the design process. We design the patterns in Photoshop, print them on high quality vinyl, cut them to size, center the designs on the flask, and adhere the designs to the flasks. FEEDBACK: Feedback is a way to establish a reputation of trust for buyers, sellers, and the Etsy marketplace and directly affects a member&#39;s reputation, so positive feedback is always appreciated! :) If for any reason you are unsatisfied, please contact us before leaving feedback to allow us the opportunity to resolve the issue. FLASK SIZE: 6 Ounce Flask Dimensions: 3.75&quot; Length, 1.00&quot; Width, 4.50&quot; Height",
