announcement: "Thank you very much for all the &quot; Get well wishes &quot; for my mother. My store is back in business and I can only hope that you find that special item again. Welcome my previous buyers and all the new arriving customers. Have a wonderful day. Bea This shop collects sale tax for Washington state residents. Please note that before purchase.",
