policy_welcome: "Welcome to my store. I appreciate each and everyone of you browsing through my store. I hope my items will spark your interest and prompt you to give a new home to the items that you like. Those are vintage or antique items, they are not perfect but I try to obtain them in a good state. Please consider that when you make your purchase. Please let me know what you like or looking for and I might just be able to find it. I am happy to answer any question if you have doubts regarding the item. I will send more information and pictures if you will need that. I am not perfect and still learning about all the items I am buying, their history, structure, and material, so please let me know if I had made a mistake. I will be, happy to correct that. My weakness are fabric and stones that I still learn to recognize correctly. I do use best advice or professional opinion before posting the items that I have questions about. Thank you and have a great day. This shop collects sale tax for Washington state residents base on your location. Please note that before purchase.",
