policy_welcome: "Hi there! I&#39;m Courtney and I am the owner of Coco + Pine. I am currently located in South Florida and have a love of the ocean and all things tropical. Many of the designs offered reflect these two loves of mine and I hope you enjoy them as much as I do! All products are outsourced from within the US and are screen printed right here in South Florida. Please e-mail me of you have any questions, comments or concerns! xx Court",
policy_payment: "All payments are due upon checkout. Your order will not be shipped until payment has been processed and cleared. ",
policy_shipping: "Coco + Pine ships worldwide! Shipping prices will vary by country so make sure you review them before you place your order. Tracking information will be included and all international orders will be processed and sent out in 7-10 business days. Shipping times will vary based upon the destination country. All US orders will be charged a $6 shipping fee and will be processed and sent out within 7-10 business days as long as all items are in stock. If your items are not in stock, you will be notified. Please double check all information and addresses that are listed so we can ensure that your order makes it to the right place on time! *CUSTOMS INFO FOR INTERNATIONAL ORDERS* All international orders require a customs card to be filled out for any packages being sent out on our end. We will be listing the actual price of the items inside as well as what items are included on these customs forms. Any and all customs fees, duties or taxes that are charged in your home country upon arrival will be the responsibility of the purchaser. Please check with your mail carrier before purchasing so that way you are aware of any extra fees. Shipping times and customs processing times will vary for international destinations so please be mindful of this when placing your order. ",
policy_refunds: "Coco + Pine is currently not engaging in refunds, but we will be happy to exchange your order for you if you are not satisfied. We understand that sometimes sizes can be wrong or a product just may not be for you! Please know that we charge a $6 shipping fee to resend any exchanges. If you ever have a question about sizing or style, please don&#39;t hesitate to shoot us a message! ",
policy_additional: "All of our items are made and provided by Delta Apparel Inc and are screen printed here in South Florida. We currently offer custom orders on existing tees (cut to crop top, muscle shirt or off the shoulder) but do not do custom printing. Coco + Pine does not offer wholeslae options at this time. We want every customer to be happy, so if you aren&#39;t, LET US KNOW! We would be more than willing to exchange/refund your order when in accordance with our refund policy. xx Court",
