sale_message: " Hello! I hope you are pleased with your purchase from designsbyegs, and may it serve you well. If, for any reason, you need me to make changes, i.e. shorten, lengthen, add extender, etc., contact me. I want you to be happy and I am pleased to make necessary changes at no cost to you. Enjoy!",
