accepts_custom_requests: true,
policy_welcome: "Thank you for stopping by my shop. I am so thrilled to have this opportunity to sell my original and handmade designs. The Etsy staff has done a great job on this site and it is my goal to compliment their work by being the best shop owner I can be. I will do that by doing my very best to make your visit and purchase one you will remember with pleasure for the fine service and willingness to please. Thanks, again, for stopping in and ENJOY.",
policy_payment: "I prefer Paypal, however, I will accept checks. I, also, accept special orders requiring payment made in advance. If the order does not work for you, I will remake it once for no charge. If you are still dissatified and you inform me within 24 hours, I will happily refund the amount of your special order.",
policy_shipping: "Items will be shipped once payment has been received and cleared. I ship priority mail (ground) within the US, which usually takes about 3 days- cost $4.95. If next day or 2nd day is warranted, I ship FedEX, DHL,or UPS. I will ship internationally, usually first class airmail. I insure your purchases. All items are shipped with my logo and a short profile of the artist (me)in an organza bag, either olive green or bliss white. I will also be more than happy to gift wrap your purchase upon request at no charge, and, after more than 20 years in smaller retail business, I am good, in fact, I am very good.",
policy_refunds: "I want you, the consumer, to be happy with your purchase. However, if for some reason you are not pleased with your item, please contact me, and I will send you an RA, which is required for all returns. This request must be made within 3 days of receiving the order and I will refund the purchase price minus shipping & handling. After that time, I will issue a store credit if merchandise is returned in resaleable condition.",
policy_additional: "I will be happy to adjust size, lengthen - add extender, or shorten. As stated earlier, I accept custom orders, but do require item be paid for upon ordering. I, also, will be happy to hold an item for 24 hours pending approval. I offer wholesale pricing on orders totaling $200.00 retail. I offer consignment in local area and surrounding cities within 100 mile radius.",
